import { useState }                 from 'react';
import styles                       from './QuestionTable.css';

export const QuestionTable = ({ questions, filteredQuestions, tests, handleDelete, handleEdit, handleDuplicate, handleNext, handleShowSelected, handleShowAll}) => {

    const [ visibility, setVisibility ] = useState(false);

    const handleShow = (event) => {
        event.preventDefault();
        setVisibility(!visibility);
    }

    let numOfTests = 0;

    return (
        <div id="questions__container">
            <div id="table__container">
                <table id="questions__table">
                    <tbody>
                        <tr className="space_under header_row border_bottom">
                            <th> ID                     </th>
                            <th> Question Text and Tags </th>
                            <th> Last Update            </th>
                            <th> Question Type          </th>
                            <th> # of Tests             </th>
                            <th></th>
                        </tr>
                        

                        { questions && questions.map((question, i) => (
                        <tr className="space_under border_bottom" key={question}>
                            <td className="question_id"           key={question.questionID}>        {question.questionID}                                   </td>
                            <td className="question_title_tags"   key={question.questionTitle}>     {question.questionTitle} 
                            <br/>
                                <label className="question_text"  key={question.text} visibility={visibility ? "visible" : "hidden"}> {question.questionText} </label>
                                {question.tags.map((tag) => { 
                                    return (
                                    <>
                                        <button className="like_tag_button" key={tag}>      {tag}                                                           </button> 
                                        <label className="like_link_label">                 {tag !== question.tags[question.tags.length - 1] ? " | " : ""}  </label>
                                    </>)
                                })} </td>
                            <td className="question_update" key={question.lastUpdate}>      {question.lastUpdate}               </td>
                            <td className="question_type"   key={question.type}>            {question.questionType}             </td>

                            { tests && tests.map((test) => {
                                <>
                                    { test.questions.map((testQuestion) => {
                                        // console.log("questionID - " + question.questionID);
                                        // console.log("questionTitle - " + question.questionName);
                                        // console.log("testID - " + test.testID);
                                        // console.log("testQuestionID - " + testQuestion.questionID);

                                        if (testQuestion.questionID === question.questionID) ++numOfTests;

                                        // console.log("numOfTests - " + numOfTests);
                                        // console.log("--------------------------------");

                                        return null;
                                    }) };
                                </>

                                return null;
                            })}                    

                            <td> { numOfTests } </td>
                            <td key="hidden" style={{display: "none"}}> {  numOfTests = 0  } </td>

                            <td className="buttons">
                                <button className="regular__button" visibility={visibility      ? "visible" : "hidden"} onClick={(e) => handleShow(e, question.questionID)   }>        Show   </button>
                                <button className="regular__button" visibility={handleEdit      ? "visible" : "hidden"} onClick={() =>  handleEdit(question.questionID)      }>        Edit   </button>
                                <button className="regular__button" visibility={handleDuplicate ? "visible" : "hidden"} onClick={() =>  handleDuplicate(question.questionID) }>   Duplicate   </button>
                                <button className="regular__button" visibility={handleDelete    ? "visible" : "hidden"} onClick={() =>  handleDelete(question.questionID)    }>      Delete   </button>
                            </td>
                        </tr> ))}
                    </tbody>
                </table>
            </div>
            <div id="under_table__container">
            <label type="text" id="showing_questions"> showing 1-{filteredQuestions ? filteredQuestions.length : ""} of filtered Questions </label>
                <button className="regular__button" visibility={handleNext         ? "visible" : "hidden"} onClick={() => handleNext()          }> Next {`>>`}                                          </button>
                <button className="regular__button" visibility={handleShowSelected ? "visible" : "hidden"} onClick={() => handleShowSelected()  }> Show Selected Only                                   </button>
                <button className="regular__button" visibility={handleShowAll      ? "visible" : "hidden"} onClick={() => handleShowAll()       }> Show All {questions && questions.length} questions   </button>
            </div>
        </div>
    )
};
